import React from 'react';
import { NavLink } from 'react-router-dom';
function Common(props) {
    return (
        <>
            <div className="container home">
                <div className="leftContent col-lg-6">
                    <h2>{props.heading}</h2>
                    <h4>{props.title}</h4>
                    <p>{props.para}</p>
                    <NavLink to="/service"><button>{props.btn}</button></NavLink>
                </div>
                <div className="rightContent col-lg-6">
                    <img src="/images/homepage.jpg" alt="homePageImage" />
                </div>
            </div>
        </>
    )
}

export default Common;
